import React from 'react';

function GitHub({ colorPrimary, colorSecondary }) {
    return (
        <svg width="1200px" height="999px">
            <g>
                <g>
                    <path fill={colorSecondary} d="M1200,10c0-5.5-4.5-10-10-10H10C4.5,0,0,4.5,0,10v99.826c0,5.5,4.5,10,10,10h1180c5.5,0,10-4.5,10-10V10z" />
                </g>
                <circle fill="#E74B4B" cx="49.513" cy="47.596" r="29.101" />
                <circle fill="#E7C61E" cx="132.657" cy="47.596" r="29.101" />
                <circle fill="#73BF44" cx="215.802" cy="47.596" r="29.101" />
                <rect y="93.155" fill={colorPrimary} width="1200" height="600" />
            </g>
        </svg>
    );
}

export default GitHub;
